            color: "black",
            strokeWidth: "100",
            stroke: "black",
          }}/>}
          size="large"
          style={{
            backgroundColor: "white",
            borderColor: "white"
          }}
        />
        <Title level={2}>Earls Yaletown</Title>
      </Row>

        <Col span={10}>

            <Image
              width={200}
              src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
            />


          <Title level={2}>üçî Restaurant</Title>

        </Col>
        <Col span={14}>
          <ReviewList />
        </Col>

    </div>
  );
}

export default PlaceView;
